import Inicio from "./components/Inicio"
import ReservatoriosDeAgua from "./components/ReservatoriosDeAgua"

const routes = [
    {
        path: "/",
        component: Inicio
    },
    {
        path: "/reservatorios",
        component: ReservatoriosDeAgua
    },
    /*
    {
      path: "/tacos",
      component: Tacos,
      routes: [
        {
          path: "/tacos/bus",
          component: Bus
        },
        {
          path: "/tacos/cart",
          component: Cart
        }
      ]
    }
    */
]

export default routes
